    $.fn.navshow = function(b,c,d) {



        $(this).siblings().find(b).hide();


       if(d%2==1){
           $(this).find(b).show();
           $(c).show();
       }else{
           $(c).hide();
           $(this).find(b).hide();

       }






    };
